import {Link} from 'react-router-dom';

const CountryInfoItem = ( {tabData, country} ) => {





    return (
        <li key={country.country} className="country-item">
              <span className='country-cases'>
              {country[tabData.countryProperty]} in
              <Link to = {`/countries/${country.country}`}> {country.country} </Link>
                </span>
                <img 
                  className="country-flag" 
                  src={country.countryInfo.flag} 
                  alt={`${country.country} Flag`} 
                />
              
            </li>
    );
}


export default CountryInfoItem;
